import React from "react";

const PostCreate = () => {
  return (
    <div>
      <form>
        <div>
          <label>Title</label>
          <input type="form-control" />
        </div>
        <button className="btn button-small">Submit</button>
      </form>
    </div>
  );
};

export default PostCreate;
